import React from 'react';
import EventDetail from '../component/EventDetail/EventDetail';
import LocationTabs from '../component/Tabs/LocationTabs';

const Location = ()=>{
  
  return (
    <div className="LocationContainer" style={{display : 'flex' , height : '100vh'}}> 
      <div className='location-left-container' style={{display:"block" , float:'left' , width : '50%'  , height:'100%'}}>
        <div className='location-left-event-image' style={{width: '100%', margin:'10px' , height:'40%' }}>
                <img src='https://upload.wikimedia.org/wikipedia/commons/1/18/React_Native_Logo.png' style={{width : '100%' , height:''}} alt = "image"/>
                <EventDetail /> 
        </div>        
            <LocationTabs/>
      </div>
      <div className='location-right-container' style={{float:'right' , width:'50%' , height:'100%'}}>
        <p> Prooo </p>
      </div>
    </div>
  );
}

export default Location;
